    - apis // 接口
      index.js // 接口整合
      server.js // 接口挂载服务
      utils.js // 接口处理工具方法
- plop-templates // plop 快速新建模板
    - component // 组件模板
    - store // vuex module 模板
    - view // 页面模板
- public // 公共文件目录
      index.html // 页面
      favicon.ico // ico
