    - api // 接口
    - assets // 静态资源
    - components // 组件
    - icons // 图标
    - layout // 布局
    - plugin // 全局 指令、过滤器、对象
    - router // 路由
    - store // vuex
    - styles // 样式
    - util // 工具
    - vendor // 第三方工具库
    - views // 所有业务页面
