      main.js // 项目入口文件
      permission.js // 权限控制
      setting.js // 初始设置
  test // 测试工具文件目录
  .editorconfig // vscode 配置
  .env.development // 开发环境参数
  .env.production // 生产环境参数
  .env.staging // 预发布环境参数
  .eslintignore // eslint 生效文件夹配置
